import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import {yellowBlockPlx} from '../plxSettings'

const StyledSlideSix = styled.div`
  position: relative;
  height: 100vh;
  width: 100vw;

  #white-car {
    position: absolute;
    bottom: 8vh;
    left: 18vw;
    width: 60vw;
  }

  .yellow-block-plx {
    height: 80vh;
    width: 40vw;
    position: absolute;
    left: 7vw;
    bottom: 0px;

    #yellow-block {
      background: #FAC943;
      height: 100%;
      width: 100%;
    }
  }

  #customer-img {
    height: 75vh;
    transform: scaleX(-1);
    position: absolute;
    bottom: 1px;
    left: 5vh;
  }
`;

function SlideSix() {
  return (
    <StyledSlideSix>
      <Plx
        className='yellow-block-plx'
        parallaxData={yellowBlockPlx}
      >
        <div id='yellow-block' />
      </Plx>
      {/* <img id='customer-img' src='images/alex.png' alt='customer' /> 
      <img id='white-car' src='images/white_car_right.png' alt='white sports car' /> */}
    </StyledSlideSix>
  );
}

export default SlideSix;
